import React, { useEffect, useState } from 'react';

const Jackets = () => {
  const [jackets, setJackets] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchJackets();
  }, []);

  const fetchJackets = () => {
    fetch("http://localhost:3001/api/products")
      .then((response) => {
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        return response.json();
      })
      .then((data) => {
        console.log("Fetched jackets:", data);
        setJackets(data);
        setLoading(false);
      })
      .catch((error) => {
        console.error("Error fetching jackets:", error);
        setLoading(false);
      });
  };

  const handleLinkClick = (e) => {
    e.preventDefault(); // Prevent default behavior of anchor tag
    console.log('Link clicked');
    // You can trigger the fetch again or perform any other action here
    fetchJackets(); // Example: Trigger the fetch again
  };

  return (
    <div>
      <h1>Jackets</h1>
      <a href="#" onClick={handleLinkClick}>
        Refresh Jackets
      </a>
      {/* Jackets list rendering */}
    </div>
  );
};

export default Jackets;
